        <div className="flex gap-4">
          <Tooltip id="tooltip1" content="This is Tooltip 1">
            <button className="px-4 py-2 bg-blue-500 text-white rounded">
              Tooltip 1
            </button>
          </Tooltip>
          <Tooltip id="tooltip2" content="This is Tooltip 2">
            <button className="px-4 py-2 bg-blue-500 text-white rounded">
              Tooltip 2
            </button>
          </Tooltip>
          <Tooltip id="tooltip3" content="This is Tooltip 3">
            <button className="px-4 py-2 bg-blue-500 text-white rounded">
              Tooltip 3
            </button>
          </Tooltip>
        </div>
      </div>
    </TooltipProvider>
  );
}
```

