1. Create a `TooltipContext` using `createContext` from React.
2. Create a `TooltipProvider` component that wraps the children and provides the state and functions to manage the active tooltip.
3. Create a `useTooltip` custom hook that returns the `activeTooltip`, `openTooltip`, and `closeTooltip` functions from the context.
4. Create a `Tooltip` component that takes `id`, `children`, and `content` as props.
5. In the `Tooltip` component, use the `useTooltip` hook to access the context values.
6. Add event listeners for `mouseenter` and `mouseleave` events on the tooltip wrapper element.
7. In the `handleMouseEnter` function, check if the current tooltip is not the active tooltip, then open it.
8. In the `handleMouseLeave` function, check if the current tooltip is the active tooltip, then close it.
9. Use the `TooltipProvider` component to wrap the parent component that uses the `Tooltip` component.

